package com.example.car_app;import java.util.ArrayList;public class Car {    private String title;    private String stock;    private String vin;    private String color;    private String mileage;    private boolean passedFailed;    private String date;    private String imgUrl;    public Car(boolean passedFailed) {        this.passedFailed = passedFailed;    }    public Car(String title, String stock, String vin, String color, String mileage, boolean passedFailed, String date, String imgUrl) {        this.title = title;        this.stock = stock;        this.vin = vin;        this.color = color;        this.mileage = mileage;        this.passedFailed = passedFailed;        this.date = date;        this.imgUrl = imgUrl;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getStock() {        return stock;    }    public void setStock(String stock) {        this.stock = stock;    }    public String getVin() {        return vin;    }    public void setVin(String vin) {        this.vin = vin;    }    public String getColor() {        return color;    }    public void setColor(String color) {        this.color = color;    }    public String getMileage() {        return mileage;    }    public void setMileage(String mileage) {        this.mileage = mileage;    }    public boolean isPassedFailed() {        return passedFailed;    }    public void setPassedFailed(boolean passedFailed) {        this.passedFailed = passedFailed;    }    public String getDate() {        return date;    }    public void setDate(String date) {        this.date = date;    }    public String getImgUrl() {        return imgUrl;    }    public void setImgUrl(String imgUrl) {        this.imgUrl = imgUrl;    }    @Override    public String toString() {        return "Car{" +                "title='" + title + '\'' +                ", stock='" + stock + '\'' +                ", vin='" + vin + '\'' +                ", color='" + color + '\'' +                ", mileage='" + mileage + '\'' +                ", passedFailed=" + passedFailed +                ", date='" + date + '\'' +                ", imgUrl='" + imgUrl + '\'' +                '}';    }}